 Common family foods:_                 
{Breakfast:_}                          
 Grapefruit;Yoghurt;Cereals with milk  
 and sugar; Bread or toast with butter,
 marge, dripping,marmite marmalade,jam,
 peanut butter; Bacon; Eggs; Fried     
 bread; Tomatoes; Baked beans;Tea;     
 Milk; Coffee; Orange juice.           
{School lunch:_} Cooked or packed      
 (crisps, sandwiches, cake/biscuit,    
 fruit,yoghurt.)                       
{Tea or cooked evening meal:_} Tea;    
 Milk; Coffee; Juice; Meat; Fish;      
 Cheese; Eggs; Baked beans; Bread;     
 Potatoes; Rice; Vegetables; Salad;    
 Soup; Pizza; Chips; Pasta.            
{Puddings:_} Crumbles; Tarts; Biscuits;
 Ice-cream; Yoghurts; Whips; Mousses;  
 Jellies.                              
{Special treats:_} Black Forest Gateau;
 Trifle; Fresh cream cakes; Special    
 home made pastries; fruit salad;cider.
